function ClientHeader({onclick, darkMode}) {
  return (
    <div className="container mx-auto px-4 pt-20 pb-16" >
      

      <button onClick={()=>onclick} type="button" className={` ${darkMode && "bg-white "  } bg-slate-950 text-white   rounded-2xl w-auto`} > Dark Mode </button>
     
      <h1 className="text-5xl font-bold text-center mb-6">Your All-in-One Digital Companion</h1>
      <p className="text-xl text-gray-600 text-center mb-12 max-w-2xl mx-auto">
        Weater updates, calendar management, note and journal tasking, and
        article readind - all in one seamless experience
      </p>
      <div className="flex justify-center gap-4">
        <button className="bg-blue-600 text-white px-6 py-3 rounded-lg font-semibold hover:bg-blue-700 transition">Get Started</button>
        <button className="border border-blue-600 text-blue-600 px-6 py-3 rounded-lg font-semibold hover:bg-blue-50 transition">Learn More</button>
      </div>
    </div>
  );
}

export default ClientHeader;
